const DeviceMaxLedLimit = 54 * 5 ;

//Channel Name, Led Limit
let ChannelArray = [
	["Channel 1", 54],
	["Channel 2", 54],
	["Channel 3", 54],
	["Channel 4", 54],
	["Channel 5", 54],

];

function SetupChannels(){
	device.SetLedLimit(DeviceMaxLedLimit);

	for(let i = 0; i < ChannelArray.length; i++){
		device.addChannel(ChannelArray[i][0], ChannelArray[i][1]);
	}
}

export function LedNames() {
	return vLedNames;
}

export function LedPositions() {
	return vLedPositions;
}

export function Initialize() {
	SetupChannels();

	sendPacketString("00 FE 33", 193);

	let packet = [0x00, 0xFE, 0x33];
	device.read(packet, 193);

}

function sendPacketString(string, size){
	let packet= [];
	let data = string.split(' ');

	for(let i = 0; i < data.length; i++){
		packet[i] = parseInt(data[i], 16);//.toString(16)
	}

	device.write(packet, size);
}

function Sendchannel(Channel, shutdown = false) {
	let ChannelLedCount = device.channel(ChannelArray[Channel][0]).ledCount;
	let componentChannel = device.channel(ChannelArray[Channel][0]);

	let RGBData = [];

	if(LightingMode === "Forced"){
		RGBData = device.createColorArray(forcedColor, ChannelLedCount, "Inline", "GRB");

	}else if(componentChannel.shouldPulseColors()){
		ChannelLedCount = 40;

		let pulseColor = device.getChannelPulseColor(ChannelArray[Channel][0], ChannelLedCount);
		RGBData = device.createColorArray(pulseColor, ChannelLedCount, "Inline", "GRB");

	}else{
		RGBData = device.channel(ChannelArray[Channel][0]).getColors("Inline", "GRB");
	}

	sendDirectPacket(ChannelLedCount, Channel, RGBData);
}

export function Render() {
	for(let channel = 0; channel < 5; channel++){
		Sendchannel(channel);
	}
}

function sendDirectPacket(LEDCount, Channel, data){

	let packet = [];
	packet[0] = 0x00;
	packet[1] = 0x32;
	packet[2] = 0x52;
	packet[3] = Channel + 1;
	packet[4] = 0x18;
	packet = packet.concat(data);

	device.write(packet, 193);
	device.read(packet, 64);
}

